import React from "react";

function CharacterLink({selectCharacter, character}) {

    return (
        <li onClick={() => selectCharacter(character)} className="character-link" style={{"float": "left"}}>
            <p>{character.name + " " + character.title}</p>
            <ul>
                <li>Class: {character.klass}</li>
                <li>Level: {character.xp / 10}</li>
                <li>Gold: {character.gold}</li>
            </ul>
        </li>
    )
}

export default CharacterLink
